_DESCRIPTION_:
Источник питания Бастион SKAT-V.12DC-24 исп. 5000 обеспечивает:
ограничение тока заряда АКБ и возможность выбора одного из четырех значений тока ограничения;
защиту от короткого замыкания в нагрузке посредством плавкого предохранителя;
защиту устройства и нагрузки от неправильного подключения (переполюсовки) клемм АКБ;
защиту от короткого замыкания клемм АКБ;
контроль наличия АКБ;
защиту АКБ от глубокого разряда в режиме «РЕЗЕРВ» путем отключения нагрузки от АКБ при снижении напряжения на клеммах АКБ;
защиту нагрузки потребителя от аварийного повышения напряжения на выходе источника путем автоматического отключения нагрузок;
светодиодную индикацию наличия напряжения электрической сети: «СЕТЬ»;
светодиодную индикацию состояния АКБ: «АКБ»;
светодиодную индикацию состояния напряжения выхода: «ВЫХОД»;
возможность подключения внешнего контакта (тумблера)«ВЫХОД» для оперативного включения/отключения нагрузок;
выдачу информационных диагностических сообщений (подключение внешних цепей индикации) и (или) управление внешними устройствами автоматики замыкающими контактами пяти реле сигнальных выходов;
возможность параллельного подключения нескольких источников к одной АКБ с целью увеличения тока заряда АКБ при необходимости подключения АКБ емкости, больше 40 Ач с управлением термокомпенсацией от одного ведущего устройства;
защиту питающей сети от короткого замыкания в источнике посредством плавкого предохранителя;
возможность восстановления работоспособности источника при подключении исправной и заряженной АКБ и отсутствии напряжения питающей сети («холодный запуск»)
